A natural numbers object in a topos is an initial
algebra of the functor X\mapsto  X + 1; explicitly, it
is an object \mathbb {N} equipped with maps *\xrightarrow {z} \mathbb {N} and \mathbb {N}\xrightarrow {s} \mathbb {N},
called zero and successor, so that for any other object A equipped
with maps *\xrightarrow {q}A\xrightarrow {f}A, there exists a unique map \mathbb {N}\to  A so that 




